const checkLoad = () => {
    let check = document.querySelector("link[sizes='32x32']");
    console.log(check);
  
    if(check != null){
      // exists
      document.querySelector("link[sizes='32x32']").href = "data:image/png;base64,";
  
      clearInterval(globalIntervalCheck);
    };
  };
  
  (() => {
    let globalIntervalCheck = setInterval(checkLoad, 500);
  })();